import { Button } from './Button';

type Props = {
    title: string,
    img: string,
    description: string,
    button?: boolean
}

export const Card = ({} : Props) => {
    return (
        <div className="card">
            <h2>Hello world</h2>
            <img src="./bayern.jpg" className="App-logo" alt="logo" />
            <p>Testitest</p>
            <Button type="primary" label='Click me!' />
        </div>
    )
}
